export default {
  methods: {
    logout (label) {
      this.$store.dispatch('logout').then(() => {
        this.$ga.event({
          eventCategory: 'Header',
          eventAction: 'Header_Link_Click',
          eventLabel: label
        })
        location.reload()
      })
    },

    tryToggle () {
      if (window.innerWidth < 993) {
        this.$refs.navCollapse.toggle()
      }
    },

    // Analytics
    gaEvent(label) {
      this.$ga.event({
        eventCategory: 'Header',
        eventAction: 'Header_Link_Click',
        eventLabel: label
      })
    }
  },

  computed: {
    isAuthorized () {
      return this.$store.state.isAuthorized
    }
  }
}
